func protobufFirepbPaginationToFirePagination(v *firepb.Pagination) *fire.Pagination {
	if v == nil {
		return nil
	}
	res := &fire.Pagination{}
	if v.Total != 0 {
		totalptr := int(v.Total)
		res.Total = &totalptr
	}
	if v.Page != 0 {
		pageptr := int(v.Page)
		res.Page = &pageptr
	}
	if v.Limit != 0 {
		limitptr := int(v.Limit)
		res.Limit = &limitptr
	}

	return res
}
